import React from 'react';
import { render } from 'react-dom';

export const Form = () => {
    const formStyle = {
        position: "absolute",
        margin: "auto",
        top: 0,
        right: 0,
        bottom: 0,
        left: 0,
        width: "100px",
        height: "100px"

    };
        
        return(
            
            <div className="form" style={formStyle}>
            <form>
                <label>
                Email :
                <input type="text"
                placeholder="Enter Your Email"
                 />
                </label>
                <div className="Captcha"></div>
                <input type="submit" value="Submit" />
            </form>
            </div>
        )
        
    
}
